    "2016-08-25T08:20:28.298660",nt"name": "san-francisco-plant-database",nt"isopen":
    true,nt"url": null,nt"notes": "Download the dataset by clicking on the
    'ZIP' button at the top right of this page.  The zip file contains an Excel spreadsheet
    listing appropriate plants recommended for sidewalks, private backyards and roofs
    that are adapted to San Francisco's unique environment, climate and habitats. These
    plants were selected with urban sustainability, biodiversity, and water conservation
    practices in mind due to their drought tolerance and provision of habitat for wildlife.
     The zip file also contains a GIS shapefile of plant community areas (areas appropriate
    for specific communities of plants, aka "phytocoenosis" or "phytocenosis").
    The plant database and plant community shapefile are used in the San Francisco Plant
    Finder website (http://sfplantfinder.org) which allows to you search for an address
    or click on a map and view details of plants recommended for that location.",nt"license_title":
